INSERT INTO `cycle` VALUES (1,'Teste','Ciclo Teste','Ciclo para testar','2018-06-18 17:42:27'),(2,'Olá! \r\n\r\nChegamos a nossa última pergunta de ciclo de feedback! \r\nIsso mesmo, depois dessa semana vamos compilar todos os resultados e mostrar para todos! \r\n\r\nEntão, por favor, continue participando que a sua resposta nos ajuda a melhorar! ','Ciclo 3','Olá! \r\n\r\nComeçamos agora nossa terceira rodada de ciclo de feedback!\r\n \r\nSegue o mesmo esquema: 6 perguntas, 1 por semana e depois divulgamos os resultados. \r\nPor favor, não deixem de responder! (carinha do gatinho do Shrek aqui)\r\n\r\nAs respostas são anônimas, então sintam-se livres para dizer o que pensam. \r\n',NULL),(3,'Olá! \r\n\r\nChegamos a nossa última pergunta de ciclo de feedback! \r\nIsso mesmo, depois dessa semana vamos compilar todos os resultados e mostrar para todos! \r\n\r\nEntão, por favor, continue participando que a sua resposta nos ajuda a melhorar! ','Ciclo 4','Olá! \r\n\r\nComeçamos agora nossa quarta rodada de ciclo de feedback!\r\n \r\nSegue o mesmo esquema: 6 perguntas, 1 por semana e depois divulgamos os resultados. \r\nPor favor, não deixem de responder!\r\n\r\nAs respostas são anônimas, então sintam-se livres para dizer o que pensam. \r\n',NULL);
/*!40000 ALTER TABLE `cycle` ENABLE KEYS */;
