INSERT INTO `feedback_answer` VALUES (1,'Bla','c5e544aa-38c1-4bc3-8276-4c0706abda46','2018-06-08 17:34:11',2,1,1),(2,'Ble','6e2daafd-d8c4-47b9-b021-c465c9418f41','2018-06-08 17:35:32',4,1,1),(3,'Bli','8312d7c5-0acd-4e71-afd6-41136c0191c3','2018-06-08 17:36:46',3,2,1),(4,'','32b77ab0-e3e6-40e7-a71d-0e36418a3745','2018-06-10 20:45:02',5,1,1),(5,'','8e1db45b-c56f-45c2-827f-abaabc7b2ec9','2018-06-19 09:38:01',4,5,6),(6,'Equipes grandes que necessitam se comunicar tanto entre eles quanto por telefone.\r\nAmbiente que se concentra recepção de fornecedores, avisos de interfone e gera muito ruído.\r\nAlém de ser um time de pessoas de pessoas comunicativas.\r\n\r\nAcredito que uma infra estrutura com acustica boa e telefonia excelente, ajudaria demais!!!!','ee92c0d8-b837-4055-a7e5-fc434bdc308e','2018-06-19 09:38:08',2,5,6),(7,'Nosso ambiente costuma ser bastante descontraído, porém não prejudica minha concentração, além disso quando desejo uma concentração total coloco um fone de ouvido, mas é algo pessoal. ','bc2ec1eb-c241-4537-b643-021529c6813e','2018-06-19 09:42:39',5,5,6),(8,'Sim, mas em alguns momentos as pessoas perdem um pouco o foco e se desconcentram.','ef75d78f-5813-4354-b5e8-488e8b1a66e1','2018-06-19 09:43:30',4,5,6),(9,'A maioria das vezes sim, mas as vezes o barulho toma conta do ambiente. ','a9a7beae-29b2-42b8-be3b-3ca856ef2b91','2018-06-19 09:47:23',4,5,6),(10,'','61a40281-9ad3-4f7d-82ce-66f24ae38651','2018-06-19 09:48:35',3,5,6),(11,'Muita gente falando ao mesmo tempo. Entendo que as vezes não tem como evitar. ','121bb853-b92e-480b-a03c-b0a6632570ba','2018-06-19 10:14:42',2,5,6),(12,'Durante alguns períodos que o pessoal fica um pouco ocioso, se animam com um certo excesso com a conversa e atrapalha a concentração de quem tem mais tarefas para fazer.','b696f918-6f50-43f9-bd0d-55e8f3594217','2018-06-19 10:16:36',3,5,6),(13,'','c8952197-864a-4875-b8b1-0ebb9f64d3a6','2018-06-19 10:40:15',5,5,20),(14,'','85aa0070-6baa-4129-820d-6d1b944cb99e','2018-06-19 10:47:14',4,5,1),(15,'','938f63bb-22c2-4ac5-8859-23ffbb4ccb97','2018-06-19 10:55:10',5,5,19),(16,'Coloquei um 4 mais por ter uma visão geral de que alguns colegas não conseguem se concentrar devido ao barulho de outros colegas (principalmente no dev). Uma forma que encontro para me concentrar 100% é ir em uma sala de aula e , agora, em uma sala de reunião.','0d409fb7-5454-4eb8-a6d8-884ed10baf69','2018-06-19 11:03:10',4,5,16),(17,'Nem sempre consigo me concentrar, na real não sei se isso é um problema pois quando eu passo por isso eu costumo mudar de lugar e tudo se resolve','202579b7-b8a9-48c6-827e-ed330959c9a8','2018-06-19 11:12:44',3,5,16),(18,'','923fa365-a97a-448b-9cbf-46e6362fa84e','2018-06-19 11:41:43',5,5,16),(19,'Uma sala com quase 40 pessoas, onde praticamente todas as pessoas precisam falar no telefone e se comunicar uns com os outros. No momento em que precisamos nos concentrar, muitas vezes tem poluição sonora de outra equioe. E muitas vezes nossa equipe \"contribui\" com o barulho também.','c6c85e67-78af-4635-85be-54b077f8d7a0','2018-06-19 11:44:14',3,5,18),(20,'','897a50b6-f633-4da0-b87a-c20f4ca0bc01','2018-06-19 11:46:50',3,5,18),(21,'Às veze, o ambiente fica muito barulhento com pessoas conversando alto, rindo, etc.  Mesmo com fones de ouvido, às vezes é difícil de se concentrar. O trabalho de revisão envolve muita leitura e atenção, nem sempre consigo ler atentamente um roteiro ou uma lista de exercícios ouvindo música com fone para abafar o barulho das pessoas, pois a música tbm pode distrair. Achi que isso pode prejudicar o trabalho, uma vez que cai a qualidade da precisão das revisões.\r\nAcredito que uma solução para o problema do barulho seria usarmos mesas redondas, onde as pessoas sentam mais próximas umas das outras evitando assim elevar o volume da voz para conversarem. A mesa redonda tbm cria a sensação de coletivo e conexão, o que pode ajudar as pessoas a perceberem o quanto atrapalham as outras que estão na mesma mesa, caso decidam falar em volume alto. \r\nFizemos isso na escola onde trabalhava e funcionou muito bem. O volume do refeitório no horário do almoço era muito alto, quase insuportável. Mudamos as mesas retangulares para mesas redondas de, no máximo, 5 lugares, o que forçava as crianças a interagirem com os colegas do círculo, não sendo necessário gritar para falarem.','79af11f8-b22a-4a03-a184-48328277e6c7','2018-06-19 11:49:24',3,5,16),(22,'O barulho atrapalha bastante, sem contar que temos que parar de fazer algo que estamos concentrados para atender porta que muita das vezes não é para o comercial PF.','1af23215-a1eb-4807-9c6e-b0d6c211d144','2018-06-19 11:57:53',3,5,18),(23,'Sempre dá pra adaptar/melhorar o ambiente para cada pessoa, isso é bom!','d9966329-931b-4658-adce-366425dc59ce','2018-06-19 12:01:30',4,5,18),(24,'','e0de7824-8821-4b11-8b98-09641fe1ee3c','2018-06-19 12:12:19',5,5,18),(25,'','24dce802-6bdc-4cf4-b152-1d7bb03cf1a5','2018-06-19 13:27:23',2,5,18),(26,'As vezes as conversas são muito altas.','312ae1d2-543a-492e-9df5-3447d9fdd22e','2018-06-19 13:28:02',4,5,18),(27,'','e5963bb4-5cf0-43eb-af99-66c10b4baebe','2018-06-19 13:38:22',5,5,4),(28,'','a95660b2-d1c7-43c2-bf93-ceeb2178b9e1','2018-06-19 13:41:29',5,5,1),(29,'','f3d259c0-495b-478c-892c-02c46b9ee886','2018-06-19 13:41:58',4,5,4),(30,'','426c5f9b-096e-4e07-868a-a3a8b1c6c077','2018-06-19 13:42:27',4,5,4),(31,'','6f77ee8a-7595-4220-bfae-8d39b0590a18','2018-06-19 13:50:50',3,5,13),(32,'','5744db56-6052-4316-81cd-dcd534c0386d','2018-06-19 13:50:55',4,5,13),(33,'','7f2faeab-918d-4979-a3eb-48d0db086671','2018-06-19 13:50:58',4,5,13),(34,'','e57d5c98-4f36-4ee8-b86a-e1c830a8d276','2018-06-19 13:51:23',5,5,11),(35,'','af4eadb4-1073-4bd9-b239-28aa52c1b8bb','2018-06-19 13:51:37',5,5,11),(36,'','84a2aab2-4093-48ac-8048-a924b1c50f41','2018-06-19 13:51:49',4,5,11),(37,'Sem problemas nenhum, sempre que preciso gravar ou silêncio eu converso e tenho.','1234f692-b068-4629-8916-5da9e6d96b5b','2018-06-19 13:53:01',5,5,11),(38,'','8a41808b-eff7-4511-a8d1-37114f594d15','2018-06-19 13:53:02',4,5,5),(39,'','f8cc41d5-e606-46ef-88a6-8f50d79e43b3','2018-06-19 13:55:47',5,5,12),(40,'','f12bb539-ab16-4df9-b540-0a39ca04b375','2018-06-19 13:58:14',4,5,13),(41,'Sim','77b39fb5-3d54-4e64-b88e-f1774f6ca1a6','2018-06-19 14:01:31',5,5,13),(42,'','8fdacaac-3758-42d8-8c48-2ded11a3117f','2018-06-19 14:02:11',5,5,10),(43,'Em geral tem muito barulho, mas é só pegar o notebook e pegar uma sala que não esteja sendo usada.','082bf39c-d5fa-4a4a-bd9b-d9d2a6f2b71b','2018-06-19 14:02:34',4,5,10),(44,'Preciso me isolar com fone de ouvido em uma altura elevada, o que não é muito bom para mim. Muito falatório.','a606ae23-718c-4f13-84c9-f958ecb2aede','2018-06-19 14:05:29',3,5,13),(45,'','75c851ae-7128-4dab-9d3d-56503358c33a','2018-06-19 14:07:05',5,5,1),(46,'Constantemente preciso buscar um local diferente na empresa que me ajude a me concentrar. \r\nOra é o barulho das pessoas convesando, ora é o ar condicionado que fica muito frio.\r\nSei que posso recorrer a campainha de mesa para pedir mais silêncio, mas me incomoda o fato de ter que fazer isso mais de uma vez ao dia. \r\nQuanto ao ar condicionado entendo que sempre será o clássico dos desacordos entre as pessoas, mas no meu caso não é simplesmente colocar uma blusa e pronto, fico doente.\r\nA infra da empresa está de parabéns, mas por conta destes dois fatores, em vários momentos do meu dia tenho dificuldade de me concentrar, visto que minha rotina é estudar e escrever.','9ca59e07-cc51-4c7e-b2c8-167dde253bcb','2018-06-19 14:07:54',3,5,10),(47,'Muito barulho','90ae2040-e5af-483c-8459-49f7cab905e0','2018-06-19 14:13:11',3,5,1),(48,'Muito barulho ','b31b5695-6c93-4d37-8d94-7c6a27478ad4','2018-06-19 14:13:39',3,5,18),(49,'','925bf462-2ca6-4a77-aa10-327fdcc80f6a','2018-06-19 14:13:43',5,5,11),(50,'muitas pessoas no telefone ao mesmo tempo, muitas conversas (sobre trabalho ou não)','24dd8c1c-726e-437f-b949-935c863db6f2','2018-06-19 14:14:47',1,5,19),(51,'','8077be41-4941-4564-8d05-4ee3c128d2b1','2018-06-19 14:16:59',2,5,10),(52,'','12b26c0b-993b-4d8c-9669-f3ba98eb3ab5','2018-06-19 14:26:09',5,5,14),(53,'','bf09f2b2-b224-4387-87dc-52514ed5cb13','2018-06-19 14:36:27',5,5,5),(54,'O ambiente pode ter bastante conversa às vezes e por trabalhar perto do pessoal do Music Dot é normal eles tocarem algum instrumento durante o dia. Eu já estou acostumado com o ambiente da Caelum, então pra mim essas coisas são normais e eu consigo me focar mesmo assim, a não ser quando as pessoas perdem um pouco o controle (o que acontece raramente).','ae53ac6f-a94c-43b0-a77d-e4830f250b27','2018-06-19 14:40:22',4,5,1),(55,'','39522dfa-36ae-495e-bc62-23b9d9964ccb','2018-06-19 14:50:02',4,5,14),(56,'','7b0e0ca9-5ac0-4c36-abe4-42a6804a59b4','2018-06-19 14:53:32',5,5,5),(57,'Tem momentos de silêncio, porém existem momentos em que há muito barulho também. Realmente é um meio-termo. O sino funciona bem na maioria das vezes e entendo que é difícil manter o silêncio o tempo inteiro, e nem acho que deve ter silêncio o tempo inteiro também! Precisamos interagir e conversar.','1f7f5ac2-f187-4125-b0c1-d5427205714d','2018-06-19 14:58:24',3,5,1),(58,'Nesse caso, a única coisa que penso é sobre barulho e silêncio.\r\nHá momentos de barulho e momentos de silêncio. Sinto que existe um equilíbrio. O sininho funciona muito bem.\r\nSei que não há como ter silêncio o tempo todo e eu também não gostaria que tivesse, afinal precisamos interagir, conversar etc.','82743627-d40b-4961-ac95-600cbc887740','2018-06-19 15:00:47',3,5,14),(59,'O ambiente é bem tranquilo.','e609224b-b5bf-4f28-9e7d-a9a4257c3f48','2018-06-19 15:07:58',5,5,4),(60,'Com a copa está mais difícil, mas onde estamos foi a localização que mais colaborou pra nossa concentração. ','a3ab1c05-3f3c-43c5-a757-ac19bd2d8bf3','2018-06-19 15:09:08',4,5,17),(61,'O ambiente poderia ter melhor isolamento das janelas, não permitindo que o barulho externo fosse ouvido de dentro do escritório. Além disso, apesar de ouvir música e trabalhar com fones de ouvido, é comum ouvir conversas e barulho dos colegas','ae6b6b91-3e96-40e9-b109-4eaa0ffcc557','2018-06-19 15:11:12',4,5,17),(62,'Com a copa está mais difícil, mas o local onde estamos agora foi o que mais colaborou pra nossa concentração (E votei como time de instrutores antes) ','d9349ca2-9531-4cf4-83fd-3aec16db417f','2018-06-19 15:11:12',4,5,17),(63,'Salas em locais de passagem, durante a copa do mundo a copa (refeitório) fica muito barulhenta.','da9a2ba1-f5f4-4e0a-9b21-9b686fd6ac8a','2018-06-19 15:11:19',2,5,17),(64,'sempre é muita coisa ne','fd710246-ef6a-458a-bd6c-858973af97b9','2018-06-19 15:11:44',4,5,20),(65,'','a0b50273-77e9-4da5-b51a-f311f79d1caa','2018-06-19 15:15:45',3,5,17),(66,'','f8967c43-f5b0-4cd3-a91d-062fa6f243e3','2018-06-19 15:19:23',5,5,14),(67,'','805e9662-33c1-44a6-9ec3-ce28f44ee75a','2018-06-19 15:19:43',5,5,14),(68,'','cc909fa4-b464-4174-9f9b-f3be3d787cf9','2018-06-19 15:20:28',4,5,1),(69,'Pela sala onde ficamos ser uma local de transição para outros espaços, às vezes, a passagem do pessoal dispersa a atenção. Mas, ressalto e entendo que há necessidade de trânsito.','9a9d0bd3-3c81-433a-97ca-80ba3839e53d','2018-06-19 16:13:26',4,5,1),(70,'Por se tratar de um espaço de transição entre outras salas. A passagem de pessoas, às vezes dispersa a atenção. Ressalto que entendo essa necessidade comum a todos.','494f55ac-606d-41e4-9d3d-133a417ff8b5','2018-06-19 16:16:34',4,5,11),(71,'','13c9cf39-fbce-437a-b7c7-953b431541e7','2018-06-19 16:40:56',4,5,12),(72,'Normalmente a sala é muito barulhenta. Eu seria mais produtiva as vezes saindo e indo pra outra sala, pra recepção, mas como tem que atender o telefone, temos que ficar na sala. Alguns times tocam com tanta força o sino que parece que vai quebrar, e só torna a sala mais barulhenta ainda. Fico o dia inteiro no trabalho, as vezes a cabeça dói de tanto barulho. Se concentrar em e-mails com todo o barulho é muito difícil. ','389c24d8-b1db-4366-bce2-c6f82aff2fbe','2018-06-19 17:15:10',3,5,6),(73,'são muitas pessoas dentro de uma unica sala, contando que todas as mesas há contato telefonico. ','61ddd38a-c1c3-44af-a6a9-c1396235d3a0','2018-06-19 17:44:12',1,5,18),(74,'Às vezes rola umas conversas em tom alto, mas não é sempre.','53b30bb3-8696-419b-83a8-bd595b2fe154','2018-06-19 18:04:37',4,5,18),(75,'tem muito barulho, instrutores falando alto, fofocas, comentários preconceituosos e conversas que preferia não ouvir. venho para a caelum para trabalhar e não para ficar falando mal de preferências ou atitudes das outras pessoas. é impossível fazer minhas tarefas sem um fone de ouvido. seria legal ter um ambiente seguro, no qual ninguém fosse exposto.','8fc51ba4-950f-494a-9750-fab3b4a8d0c5','2018-06-19 23:08:34',1,5,10),(76,'','7623b949-337a-48be-9864-f60e792ce63f','2018-06-19 23:27:56',5,5,13),(77,'Depende da vibe da galera, às vezes é tranquilão, às vezes impossível manter o foco com tanta gente legal te distraindo. O foda mesmo é a audição... pra abafar o barulho preciso usar fones de ouvido com sol alto, detonando minha audição...','a35858cf-1bbd-474d-9a42-918cc1f21061','2018-06-20 09:31:31',3,5,1),(78,'Na maior parte do tempo sim.\r\nAcredito que os colegas precisam tomar mais atenção para não exagerar o nível de barulho...','83e91e81-36ed-451b-95e3-a7cc6551675e','2018-06-20 10:37:31',4,5,9),(79,'O barulho na sala atrapalha demais e nem sempre esse barulho é de conversas paralelas, muitas vezes tem muita gente com cliente no telefone ao mesmo tempo e fica muito difícil se concentrar, e então começam a tocar o sino e fica pior ainda.  Algumas vezes é preciso sair da sala pra se concentrar em alguma tarefa. ','94b3b7e8-5119-49f0-aee5-8b2c9bd91f40','2018-06-20 10:41:53',3,5,9),(80,'As vezes tem um silêncio e as vezes é um barulho sem fim','e0338b5f-968e-4d10-96a5-559fe38535e0','2018-06-20 11:22:46',4,5,9),(81,'A sala é muito grande e tem muitas pessoas no mesmo espaço o barulho em alguns momentos atrapalha bastante. ','6b0b2923-1b4b-4f56-a637-90532db30578','2018-06-20 11:29:30',3,5,9),(82,'No dev tem horários com muito barulho.','8e49e938-451f-4a93-a667-942a58f3d6af','2018-06-20 12:51:24',2,5,1),(83,'','cbc2d292-5e99-401e-b64c-82c947153219','2018-06-20 13:30:48',3,5,1),(84,'Em meados do dia o ambiente perde o foco total, tendo conversas totalmente paralelas que não agregam em nada o lado profissional. Se fosse uma discussão técnica, algo que sinto falta na empresa, seria totalmente compreensível e assim por mais que exista a perca de concentração seria por algo bom. \r\n\r\nNos demais casos, o que tenho feito: saído da sala rumo alguma sala de sala, onde mantenho foco, senão coloco o fone de ouvido no máximo e toco o sino quando ainda assim a altura está muito alta.','5d6039ea-3732-4414-927c-5446b33b8e3c','2018-06-20 13:32:42',2,5,1),(85,'Muitas vezes as conversas paralelas e fora do contexto de trabalho atrapalham a concentração. Outra coisa que também atrapalha e muito é a iluminação, ou melhor, a falta dela.','d610e31e-597b-46ef-87f1-615e20e4ae43','2018-06-20 14:23:23',3,5,1),(86,'As vezes as pessoas abusam do uso do sino e acaba se tornando irritante,há momento que não tem ninguém no telefone e a pessoa ta tocando o sino com toda a força, sendo que é a própria mesa que está fazendo barulho, nestes casos seria mais viável dar um toque entre o próprio time, solicitando menos barulho, ou que falem mais baixo.  ','36ed74c9-5574-476c-90ce-596724fcb8be','2018-06-20 15:37:57',4,5,6),(87,'Na maior parte do tempo sim, o problema que existe, que é de muito barulho e conversas muito altas não sei se são coisas que a Caelum em si pode ajudar, ou se é cada um cuidar pra não fazer barulho. Talvez podíamos estudar algum tipo de foro para o teto que ajuda a abafar o som, como em estúdios. E as vezes a internet caí, mas se que já estamos consertando isso.','9a791b2f-fd20-4ce1-9424-7a62d5a38c64','2018-06-20 17:20:52',4,5,1),(88,'','fb74958d-9bd5-4dde-a9ab-a3f333ff9137','2018-06-20 21:42:25',5,5,1),(89,'Sim, a','735949d7-e63f-441b-a8c9-baf1100784ec','2018-06-21 16:08:02',5,5,9),(90,'','48c59b23-9dff-455f-ab52-6176c4019d8d','2018-06-21 16:14:27',4,5,1),(91,'Em muitos momentos sinto necessidade de trabalhar de forma mais isolada utilizando salas de aula por conta de, algumas vezes, o ambiente do dev ficar muito barulhento. A disponibilidade de mais mesas pro dev recentemente ajudou.','3e21f65a-f920-4af6-81d5-46c6ee87c695','2018-06-21 16:33:20',4,5,1),(92,'','d6d78228-e12e-4fb6-91d3-3ffbec0f6aa8','2018-06-21 23:28:06',3,5,1),(93,'Só as vezes que o pessoal exagera que ai complica um pouco, mas faz parte.','4cccde9c-61e7-4df8-96da-ba76b40adf82','2018-06-22 11:24:39',4,5,1),(94,'A sala de dev onde tem os puffs geralmente tem muita conversa, e eu acabo entrando no meio da conversa ou pelo menos ouvindo por curiosidade. Isso acontece em muuitos períodos ao longo do dia.\r\nEu confesso que ainda não tentei usar a outra sala, que tem os banheiros e as salas de vidro, penso em testar mas acabo automaticamente indo pra sala com os puffs e me instalando lá. Até porque ainda as pessoas com quem gosto de tirar dúvidas geralmente estão lá.\r\nTem o fato também de a outra sala, com os banheiros, ser mais quente normalmente, mas agora no inverno isso não será um problema.','94d1a46a-641c-4c42-8257-dff68efb88b5','2018-06-22 18:24:38',2,5,1),(95,'','7ecb65e5-b5da-461c-a14f-a8e772078cb1','2018-06-25 12:04:57',5,5,8),(96,'internet caindo tira concentração','fb4bf068-4607-4eca-a66c-597940528b93','2018-06-25 12:06:58',3,5,8),(97,'','baba9f10-8f63-4955-a4b6-0659b586be9b','2018-06-25 12:07:24',5,5,8),(98,'Após a mudança de sala, o ambiente ficou muito melhor para a concentração. Antes com as salas compartilhadas existia momentos em que tinhamos que colocar fone com música para abafar as conversas paralelas.','d9bc7365-e16f-40bb-bd6f-c384ce7ccdf9','2018-06-25 12:09:20',5,5,8),(99,'Às vezes acontece um pouco de baderna por causa de alguma discussão acalorada, mas no geral dá pra se concentrar.','fe4ef8dd-0f13-48a4-886e-5a992716bd39','2018-06-25 12:13:59',4,5,8),(100,'As vezes conversas paralelas atrapalham a concentração, principalmente discussões técnicas específicas. Poderiamos ter mais salas de reunião e incentivar que esse tipo de conversa fosse feito em outro ambiente, para não atrapalhar ninguém.','c2f9eab3-9920-493e-8a4f-a81e2bf49cc7','2018-06-25 12:15:15',3,5,1),(101,'','bfa23eb7-41b6-4c6e-81cf-0d0faf3ae04f','2018-06-25 12:18:03',4,5,10),(102,'Tenho problemas em me concentrar quando acontece muita conversa, mas no geral tudo bem','ac106f7d-0a6f-492c-94c2-3db8ed0ab00c','2018-06-25 12:24:27',4,5,8),(103,'Hoje em dia sim, porque temos menos pessoas para o espaço, mas no início, quando eram muitos, ficava mais difícil.','be64d568-5ea9-40d7-8951-cb50b592c779','2018-06-25 12:31:12',5,5,10),(104,'','ed4534a9-4ed5-4516-8d11-b6e34214b289','2018-06-25 12:31:25',3,5,15),(105,'','c469311f-238c-445e-8403-c6bfb3dbe987','2018-06-25 12:32:12',5,5,15),(106,'','dd79cd9d-577f-43a1-bb9a-68630f60abf7','2018-06-25 12:41:37',4,5,15),(107,'','6303159c-7082-483f-81a5-6b587db271c5','2018-06-25 13:02:59',4,5,10),(108,'','4c44543d-a051-4910-8ede-30a57655ccd6','2018-06-25 13:03:33',4,5,15),(109,'','0af639a6-28d9-4718-b3ec-afe8f20cc33e','2018-06-25 13:19:20',5,5,1),(110,'','8dae074e-7971-44d3-a84d-3c9d834f750b','2018-06-25 13:29:04',4,5,12),(111,'','5cb65ebe-d912-436b-841a-0e7933a42a2f','2018-06-25 14:02:04',3,5,7),(112,'As vezes tem bastante barulho gerado pelos colegas da mesa próxima ao aquário.','789f15bf-dce4-4979-b17d-43807fb492e6','2018-06-25 14:36:21',4,5,2),(113,'Na sala 62 é bem complicado quando está cheia. Mas agora que passei a ficar na 63, está bem tranquilo.','91d5c073-832d-4394-a665-a82d075b7035','2018-06-25 15:53:24',4,5,1),(114,'','c7cd3bae-0751-41cf-a655-04ffad473803','2018-06-25 16:18:40',4,5,7),(115,'','876ec3b1-75c0-418a-89c0-80cffb78ad91','2018-06-25 16:19:18',4,5,7),(116,'','871e1870-2baa-4497-a4f9-8ed56392c023','2018-06-25 16:42:46',4,5,1),(117,'','62eda665-d8ec-4688-a223-00a8593ab7e9','2018-06-25 16:42:59',4,5,1),(118,'É um meio termo porque eu sei qual é a causa e às vezes eu sou parte da causa. Fica difícil ter um controle. Mas fones de ouvido são essenciais','2d999c81-5e17-4f58-96e5-3e4be8fdfdcb','2018-06-25 16:58:10',3,5,2),(119,'Aqui tenho ar condicionado, dois monitores e plena permissao de exercer meu trabalho em tempo integral. As cadeiras podem ser diferentes','73231062-fbe6-4250-af7d-c00f7b9d1cdc','2018-06-25 16:59:19',5,5,20),(120,'','99be645c-2ddc-473a-b219-c16078add69b','2018-06-25 16:59:55',5,5,20),(121,'','cd1c5ebe-ddf0-489c-8670-d829b7beb666','2018-06-25 17:52:23',4,5,7),(122,'','ba08fd00-f939-4cf9-96cd-906a222db43a','2018-06-26 08:12:03',5,6,16),(123,'','d39b0c7b-83f1-435c-a758-610ec6caf513','2018-06-26 09:02:20',4,6,10),(124,'','6a73654e-8b2e-4c80-b721-9493c72dc483','2018-06-26 09:03:55',5,6,1),(125,'','eb393114-94bc-4fa3-b8af-72d3cc880e4f','2018-06-26 09:04:04',4,6,6),(126,'Só algumas, a líder está preparada por exemplo. Mas existem pessoas que acredito que foram colocadas em certos cargos por questão de afinidade ( acho que amizades não devem interferir, e sim capacidade) e que não tem preparação para o que está fazendo.','d622809e-1d5d-42ba-bc49-8ece66abc400','2018-06-26 09:05:26',3,6,6),(127,'Acredito que no meu time todas sabem exatamente o que deve ser feito e como deve ser feito. Dei 4 pois apesar de sabermos como fazer nosso trabalho ainda cometemos alguns erros, sempre precisamos melhorar.','64ccc283-6ace-43b3-bd80-9b5ebb32f91d','2018-06-26 09:06:47',4,6,6),(128,'É triste ver que algumas pessoas são jogadas em cargos sem algum ou nenhum preparo, muitas vezes por não terem alguém melhor para a posição. Resultando em lideranças falhas e frustando essas pessoas por não se sentirem boas o suficiente e se adaptarem ao cargo. Pior é ver essas pessoas sendo \"rebaixadas\" de cargo novamente. ','33c39c9a-cbbb-497d-991a-a48b1c6a3ef8','2018-06-26 09:09:33',3,6,6),(129,'','47510386-dbbe-443e-b406-61c8dc98f980','2018-06-26 09:09:41',4,6,19),(130,'','ca8ddf7e-eaf8-4ded-8293-d4c9f4b67010','2018-06-26 09:09:49',4,6,1),(131,'','3366d0df-410a-46d4-8a71-15fd4584e5d3','2018-06-26 09:14:57',3,6,6),(132,'','62cb8b07-1219-4403-aedb-5e78c69d1fbb','2018-06-26 09:24:24',4,6,4),(133,'Sinto muito confiança na pessoa que está exercendo o cargo maior hoje na Caelum Brasília, tem muita responsábilidade, compromisso com a equipe, e alé disso uma  sensibilidade humana para tratar conosco que é impar. Parabéns!','618953ad-8b7a-439d-8f68-d69a7e7060ba','2018-06-26 09:41:14',5,6,4),(134,'A pergunta poderia ser melhor elaborada ou, então, poderíamos ter uma outra pergunta. Se existe maturidade profissional? Sim. Maturidade emocional? Muito pouca. A maturidade emocional da empresa, como um todo, é muito baixa. ','b9187702-19f3-49fd-83c1-64d1e2f8b8eb','2018-06-26 09:44:04',3,6,13),(135,'','7d979ac5-2e30-49a2-9e00-5e0c9b61747c','2018-06-26 09:48:19',5,6,1),(136,'','5f23980f-8f50-4bd9-abbd-2e72a86344df','2018-06-26 09:49:27',5,6,5),(137,'','4bce88bf-9540-453e-b717-0d8590b9ddc5','2018-06-26 09:50:42',4,6,1),(138,'Passamos  e estamos passando por um processo de conhecimento e desenvolvimento, onde as tarefas foram direcionadas dessa forma cada um consegue se preparar e dedicar o máximo aquela função. Mas como sugestão, falta preparação, um planos de estudos para nossos funcionários, educamos outras empresas (b2b) a investir em nossos cursos e em nosso acompanhamento, mas nós funcionários não temos um plano de estudos dentro da Alura, no meu caso. ','7d2e3906-6a1e-4a3c-8272-96ce5f279270','2018-06-26 10:03:09',4,6,6),(139,'','75fd97f1-cb4b-45af-958d-d6f51677164f','2018-06-26 10:05:13',5,6,1),(140,'','9ba4355c-7cef-4b3e-817b-4820f8daf961','2018-06-26 10:17:25',5,6,14),(141,'','409b7ddc-a60d-409e-9612-bcfeeb56aafa','2018-06-26 10:19:00',3,6,19),(142,'A maioria da minha interação é com revisora de didática e time de vídeo, nesse caso acho que eles estão bem preparados.','c0a99462-85c0-483c-8054-3fd3bcd52f4d','2018-06-26 10:27:49',4,6,1),(143,'Na equipe em qual trabalho sinto que OS VENDEDORES estão preparados. Estamos vendendo muito bem, conhecemos o produto e temos argumentos para utilizar o cliente. o time está 100%.\r\n\r\nNa supervisão, sinto que falta um pouco conhecimento do produto e a forma de lhe dar com o time! Geralmente trata os nossos problemas e dificuldades como se fossem coisas bobas e simples de resolver, mas sabemos que não é assim que funciona.\r\n\r\nEm relação ao RH, muitas informações chegam de uma forma e quando é oficializado a informação chega de outra maneira. Diversas informações desencontram, gerentes passam uma situação, RH passa outra e Adriano finaliza com outra.\r\nNão sei se é falta de preparo ou desorganização, mas situações como essa acabam desmotivando os funcionários e causando grande situação de stress. Ex: Black friday, falaram que o valor seria pago em dinheiro (Fizemos extra, trabalhamos até mais tarde, ficamos de sábado e domingo sem opção de recusar) e no final acabou entrando como banco de horas, e hoje em dia falam que nem temos banco de horas.\r\n\r\nOutro exemplo:\r\nPrimeiro jogo do Brasil: gerente mandou no slack (Está printado) que poderíamos assistir o jogo fora e pagar as horas depois. Um dia antes do jogo mandou um monte de mensagem informando que seria chato sair da empresa pra assistir, que ficaríamos marcados pela diretoria, que pega mal e etc. Sendo assim, por qual motivo nos deu a liberdade para escolher, e um dia antes do jogo simplesmente muda de ideia?\r\n\r\nSegundo jogo do Brasil:  Antes haviam mencionado que poderíamos assistir fora e pagar as horas depois, correto?\r\nNeste jogo não tivemos essa opção a própria gerente confirmou todos para assistir o jogo aqui, e no final fica perguntando \"PODE SER ASSIM? ESTÁ CONFIRMADO?\" Não foi uma escolha, não existe motivo para nos perguntar se não podemos escolher e temos que vir!\r\n\r\nOutro ponto de desencontro de informações ou falta de preparo: \r\nFINANCEIRO havia informado que independente se o jogo fosse assistido do comercial ou da copa seria descontado as horas, gerente informou que assistindo aqui não seria descontado. Fomos descobrir apenas no dia que não vão descontar. \r\nSão situações bobas, mas acabam desgastando todo mundo, são praticamente 30 pessoas no comercial e cada um com uma versão de cada situação que ocorre, mas no final nunca sabemos que é a informação correta.','4e4ae00e-465e-4165-93c6-9bac6aa2fc08','2018-06-26 10:28:05',2,6,19),(144,'','bf7404d9-f78a-4c49-9da2-67c2d271f168','2018-06-26 10:29:26',4,6,1),(145,'','87a930a8-ee04-4952-bb0f-dbaad8282130','2018-06-26 10:34:18',2,6,13),(146,'','db6703fd-2aa2-42f0-bfdc-14b9e57935aa','2018-06-26 10:38:08',5,6,10),(147,'Só encontro ótimos profissionais nessa empresa.','09821583-2b2c-4a8c-8012-aefb684f61f7','2018-06-26 10:52:44',5,6,10),(148,'','048c63fb-7d3b-466b-9489-4ed0a84bdfea','2018-06-26 10:53:08',5,6,11),(149,'','ec7f5529-1042-4bdb-8eeb-debce0a89d74','2018-06-26 10:54:59',5,6,5),(150,'','a9e6db1e-fac5-4531-8ca3-22a2b5684db0','2018-06-26 10:59:39',5,6,1),(151,'Acredito que a maior contribuição profissional dos instrutores é já ter trabalhado dentro da área de atuação da proposta de cada carreira de curso desenvolvido.','a7373d07-5759-4867-869d-e5a853f5457d','2018-06-26 11:01:37',5,6,11),(152,'','94b818b9-0d72-4674-a209-ff6c8cdecfd2','2018-06-26 11:05:33',4,6,18),(153,'Precisam de mais treinamento para saber o por que vender, o que estão vendendo, como vender. Precisam saber lidar com a palavra \"desconto\", pois tem diversos contratos que são aplicados descontos e que poderiam ter sido fechados sem, ou vice-versa.','c08e19b2-d484-48ec-a1ce-c71c6abd7bc3','2018-06-26 11:08:52',3,6,18),(154,'','1f70258d-9c78-45c5-a8c6-c5641945777c','2018-06-26 11:09:18',5,6,13),(155,'','ca2e2978-3353-4063-abfc-0f7a57b17817','2018-06-26 11:19:37',5,6,1),(156,'','0b85ec6e-6196-4d9b-b2f0-a797bbfafcec','2018-06-26 11:24:41',5,6,20),(157,'','20aef04f-8586-4cea-b2ef-c3c39365bc46','2018-06-26 11:24:52',4,6,1),(158,'Acredito que sim. Os funcionários da unidade que trabalho sempre estão dedicados a dar o seu melhor no trabalho.','f0e1755b-df11-4847-9d2a-68aa5430bcee','2018-06-26 11:26:32',5,6,5),(159,'Não. Infelizmente a Caelum ainda possui uma visão estreita sobre os colaboradores. Ultimamente, as oportunidades seguem para pessoas que não possuem tanta experiência, simplesmente por terem bom relacionamento com pessoas de cargos maiores. E nisso, sentimos que muitos não possuem treinamento adequado para tal função, enquanto alguns mais velhos de casa, talvez melhores capacitados, continuam estagnados.','b452dfae-8ab2-4581-8ff8-82c58193bfd0','2018-06-26 11:27:20',2,6,19),(160,'Precisamos de treinamentos melhores para líderes e gestores. Precisamos de mais cursos para funcionários, precisamos aprender mais com as técnicas audiovisuais do mercado, precisamos aproveitar melhor as habilidades e conhecimentos das pessoas e envolve-las em nossas ideias. ','d038989d-973d-4669-b2ee-0dd124c92d6f','2018-06-26 11:30:19',4,6,20),(161,'','d595a926-25b6-4704-ad6c-2f63e939b820','2018-06-26 11:38:14',3,6,18),(162,'','f925625b-5fa8-4099-9255-e95442e32465','2018-06-26 11:47:57',4,6,19),(163,'','626ced9d-e49f-4bbd-acda-593a997643da','2018-06-26 11:52:41',3,6,10),(164,'','1d3fa0f4-4838-4ee7-8732-3c81b84d670f','2018-06-26 11:55:37',3,6,1),(165,'','4bbf04d8-2f7c-44ed-b06d-f171c286286a','2018-06-26 12:08:05',5,6,10),(166,'','774fdfee-5a23-46a2-927c-664d2fdea79d','2018-06-26 12:11:04',5,6,13),(167,'','c96838ea-7f65-48b5-9db1-80472eb661b6','2018-06-26 12:22:57',5,6,4),(168,'Sinto que as pessoas que interajo pessoalmente no Rio de Janeiro estão preparadas, mas quando tive que interagir com alguns profissionais da minha área em São Paulo não tive a mesma impressão.','dea57280-df87-4075-8b58-f58da231b725','2018-06-26 12:24:15',3,6,11),(169,'','2cffe89f-a125-41ce-887d-936fcf2b4c8a','2018-06-26 12:25:47',4,6,11),(170,'','49afdbfc-972b-40a6-a57f-1379bbe87cc6','2018-06-26 12:32:25',4,6,1),(171,'','22368e9a-b4b0-4c64-ae61-89fc612a9ea2','2018-06-26 12:35:43',5,6,12),(172,'','64216e7d-7335-4769-bf8c-fa80fbf5cf78','2018-06-26 12:36:18',5,6,12),(173,'Acredito que parte das pessoas que lidam com pessoas agem como se fosse algo matemático, não se importando com os sentimentos e/ou fatores humanos.','e247aaff-e20a-414d-870b-5e03865c79f0','2018-06-26 12:37:22',2,6,1),(174,'Sinto grande responsabilidade nas pessoas com as quais trabalho. inclusive tenho orgulho de falar de diversas delas','44c96d3a-e673-4bf4-b9e9-ba2f87fcd52e','2018-06-26 12:46:28',5,6,1),(175,'','5b68c798-d3a3-496d-9214-352bed4c3cbe','2018-06-26 13:00:13',5,6,13),(176,'','b58e48d1-24ac-4384-8a78-c442e1187dbc','2018-06-26 13:12:23',2,6,13),(177,'Todos os meus colegas de trabalho são competentes, inteligentes e dedicados às tarefas. Falta de conhecimento em alguns cenários existe, porém, todos estão aptos a aprenderem qualquer conteúdo que não domine.','c2ff5620-0732-4755-92a9-3292c9e582ef','2018-06-26 13:24:07',5,6,1),(178,'','815bda76-ec7b-42c9-9137-8eb43f2a990d','2018-06-26 13:34:42',5,6,20),(179,'','ea4e9a4c-8441-4069-bcc8-28dd2d91fdf9','2018-06-26 13:41:03',4,6,2),(180,'trabalho de rotina impecável, mas a parte do gerenciamento de pessoas, o interpessoal (jeito de se falar com as pessoas, etc) acho falho ','f7995869-fe3c-4ee8-bfbf-2aa9d3133874','2018-06-26 13:47:45',4,6,18),(181,'','a21a90a2-3193-4f68-8d4a-f42cc0ca330c','2018-06-26 13:52:30',5,6,1),(182,'','5bcff460-d6bd-4f5a-8927-5054cc7068b7','2018-06-26 13:57:36',5,6,4),(183,'Existem pessoas muito preparadas, ou que por mais que não tenham experiência/formação na área, estão estudando, fazendo cursos, se envolvem com a área. Além de também terem boas condutas, aproveitarem a flexibilidade da empresa com inteligência etc.\r\n Porém, infelizmente, vemos muitas pessoas na empresa que estão muito acomodadas, que não correm atrás, não estudam, não aparecem na empresa, se aproveitam da flexibilidade de uma maneira muito ruim (literalmente \"se aproveitam\") e mal realizam as tarefas que seriam da sua função... E infelizmente são essas pessoas que geralmente são bastante valorizadas aqui dentro, enquanto muitos dos que fazem as coisas corretamente e até além do que precisavam, não recebem o devido valor. ','cb29ba3c-9618-428e-995b-8a1459e1cb36','2018-06-26 14:00:42',3,6,14),(184,'','921feaf2-10ff-44fb-8cc6-2cdfd29d2475','2018-06-26 14:17:56',5,6,1),(185,'','9b08cde3-f5ad-4903-83c9-573b378ba664','2018-06-26 14:18:45',5,6,14),(186,'','5dead5b4-140a-4e2c-bf95-339bba7eaaca','2018-06-26 14:19:13',4,6,1),(187,'Quando comecei a trabalhar na empresa via muitas pessoas referências em cada área de atuação (devs e instrutores), e hoje cada dia mais vejo a empresa perdendo essas referências técnicas. Vejo uma equipe de bons profissionais com potencial, mas sem lideranças técnicas dentro das equipes.','177d88cb-124d-4b5f-813e-32ca7a6c0620','2018-06-26 14:22:10',3,6,1),(188,'','31b8ac6b-47b3-4220-889c-4dc353b332a4','2018-06-26 14:22:18',5,6,16),(189,'','d649e3fb-2cea-45ea-88ba-1f4502ccf402','2018-06-26 14:28:25',3,6,1),(190,'','3931eb0d-4dc5-46cc-a90c-b779756349e4','2018-06-26 14:28:44',4,6,1),(191,'','1ce240f7-eeaf-4b36-bb62-4fd27ce626f1','2018-06-26 14:28:48',3,6,13),(192,'considero que os revisores de didatica estao preparados mas que a revisao de codigo infelizmente nao esta','0b8af90b-8fb0-4b3d-a5fa-9372b550329d','2018-06-26 14:34:11',3,6,10),(193,'','5027a084-4c07-4fbd-b955-b8eb20fb2f6f','2018-06-26 14:36:37',4,6,1),(194,'Em sua maioria estão preparados, mas alguns tem gaps de conhecimento que precisam ser preenchidos. Algo especial que precisa ser trabalhado é a liderança, especialmente em líderes mais novos. ','b1c3dadf-318e-441e-96bc-7732b9433dc5','2018-06-26 14:59:12',4,6,1),(195,'Existem pessoas que estão em certas posições mais por necessidade da empresa do que a pessoa realmente estar preparada para exercer a função que lhe foi colocada','1765d316-0f54-4951-af31-f31c5345ecce','2018-06-26 15:04:00',3,6,2),(196,'A maioria das pessoas com quem interajo no dia a dia são preparadas para seus cargos. Algumas não.','ae0eb1a7-2aa1-4602-92a0-bdfc2490485a','2018-06-26 15:06:47',4,6,16),(197,'Achei essa pergunta de hoje meio esquisita. Não sei como soou pras pessoas, mas perguntar se eu acho alguém capaz de exercer o que ele exerce me soou meio estranho, porque parece um pouco prepotente da minha parte me colocar como julgadora da \"eficiência\" de alguém na função. Muita gente dentro do meu círculo pode atuar em áreas que nem faço ideia das dificuldades, mas a forma que cada um trabalha (ainda mais num ambiente aberto que nem a caelum) não sei se os colegas poderiam avaliar. Perguntaria isso pros líderes talvez, de outra forma... \"O colaborador tal tem, depois desse período de trabalho com a gente, tem mostrado um desenvolvimento legal?\" ou algo assim. ','357877db-3ca7-4e96-9e6a-196b9ca23673','2018-06-26 15:37:46',5,6,10),(198,'','69f9aa62-5324-4f3f-b325-f9b415d0e0dc','2018-06-26 16:18:31',3,6,1),(199,'Minha (meu) lider esta preparado (a) sim. Inclusive, super me desenvolve. \r\nMe dá autonomia e liberdade pra eu estudar, evoluir e me chama pra nossa realidade sempre que viajo muito.\r\n\r\nEssa minha liderança é a única que posso avaliar, as outras não tenho contato e não me contamino e não tomo as dores pelas conversas paralelas.\r\nMinhas colegas de trabalho estão no mesmo nível que eu, por isso acho que todos estão preparados e em constante evolução.','2da29c78-fbdd-4de3-a8a4-d14d8beccd67','2018-06-26 16:27:29',4,6,6),(200,'Algumas pessoas estão preparadas mesmo não tendo formação para tal, pois estão sempre estudando e correndo atrás de coisas para melhorar em seus cargos. Mas infelizmente, muitas pessoas não estão capacitadas para o cargo que exercem e ainda por cima acreditam que fazem muito mais do que realmente fazem.','d741ffb8-74a6-4f34-9d7e-6126bf86ed7e','2018-06-26 16:32:30',3,6,1),(201,'','84fca2e9-5fb4-48ec-9b0a-922cd272982e','2018-06-26 17:36:24',3,6,1),(202,'','a5632cfe-0f49-447f-af4f-3d33406cc2a7','2018-06-26 17:36:49',5,6,11),(203,'','24ef06a4-b04e-49d9-9c54-6319490b2820','2018-06-26 23:24:29',2,6,1),(204,'','c05b0b2c-8bc6-4ae4-a6b2-fde24ed73498','2018-06-27 13:01:33',5,6,8),(205,'','8c940c62-92b9-44c2-83ee-35405bd53684','2018-06-27 13:11:42',4,6,1),(206,'','3aaa953f-7c2a-4408-bf3c-36ae553e7e62','2018-06-27 13:14:06',4,6,1),(207,'','151890e2-eb68-42f0-98b6-e104d3a61302','2018-06-27 13:14:35',4,6,7),(208,'','172d0802-93d0-40ff-99f1-138f5dab7a77','2018-06-27 13:23:27',4,6,7),(209,'Infelizmente não sinto isso!\r\n\r\nVejo a galera de vendas da Caelum mencionando muito que precisam de desconto para vender, e muitas vezes não é o desconto o importante e sim capacitar a equipe com um curso/treinamento, para que eles saibam vender e negociar a melhor forma entendendo a necessidade do aluno. Acredito que enquanto não tenha profissionais de vendas a necessidade de uma porcentagem maior de desconto sempre irá aparecer.\r\n\r\nAqui na Alura Pessoa Fisica, também acredito que estamos precisando de melhores profissionais e algum treinamento para melhorar as vendas.\r\n\r\nAcho que seria bacana também que todos soubessem e conhecessem um pouco dos outros setores, como eles trabalham, quais problemas resolvem etc... ','bd64ecb0-8ad6-4c1a-b98b-074165894569','2018-06-27 13:25:01',2,6,18),(210,'','6890435b-2fce-4706-ba07-c9ceda84eb43','2018-06-27 13:27:40',4,6,8),(211,'','04130947-d637-4fbb-888c-ff888488abfb','2018-06-27 13:28:58',5,6,7),(212,'','69ec49e0-af25-4136-874b-a48e3705c83c','2018-06-27 13:46:46',5,6,8),(213,'','fb4ec7dc-de70-4d7a-ad06-f4b65c1dec48','2018-06-27 14:01:16',4,6,2),(214,'','2639f4d6-1075-46f1-ac93-a84c7f6b376b','2018-06-27 15:30:44',5,6,8),(215,'','e8466d87-e708-49ce-9274-d42ff385349d','2018-06-27 15:50:21',5,6,8),(216,'Acho que o time está bem qualificado, sim :)','d33d0e7c-93ff-4e61-9ee9-04472646611a','2018-06-27 16:55:17',5,6,1),(217,'','00bf012b-8655-457c-921d-9731cf565ab0','2018-06-27 16:55:39',5,6,17),(218,'Acredito que sim, pelo menos estão todos se preparando e estudando as coisas que tem que estudar pra ajudar nas obrigações.','c6783fb7-cf42-4a12-937b-30c81158c294','2018-06-27 16:59:16',5,6,8),(219,'Não interajo o suficiente para saber se há (imagino que possa ser) sobrecarga de serviço, mas noto algumas falhas no RH. Atraso em alguns processos, necessidade de cobrança constante, falta de informação...','ff1f1c61-c571-4b16-b642-0babd1ef27cc','2018-06-27 17:06:11',3,6,17),(220,'','4004cc48-25f9-4ea4-8360-e0c9697fa811','2018-06-27 17:16:53',4,6,17),(221,'Tem pessoas que exercem um ótimo trabalho, mas a questão esta em usar o \'\'poder\'\' para benefício próprio, ou apontar o próximo sem ver a si.\r\nDar a opção de não vir ver o jogo, mas avisar que é melhor vir!\r\nFalar que está trabalhando home e esta ali para ajudar e depois cobrar a falta de atenção da equipe na frente de todos por não ver um e-mail sendo que a mesma também não viu.\r\n\r\nAs mudanças estão recentes, então estamos todos aprendendo!','74077d2c-ccff-4af9-8aaf-13b70698b293','2018-06-27 18:03:18',3,6,18),(222,'Sim. A equipe é sensacional, tem uma conhecimento muito grande em suas funções. Inclusive serve de inspiração para mim','d8ffef3b-5c93-4c20-a76a-742fa9d098e9','2018-06-27 18:36:09',5,6,8),(223,'Nem todos exercem efetivamente o cargo que ocupam, deixando trabalho extra para aqueles que sim.','55215e7e-2498-472d-ac39-0e9b62c45107','2018-06-28 02:58:14',4,6,8),(224,'','f7b24858-f62b-4396-8f55-8e27657f0b68','2018-06-28 14:30:08',3,6,18),(225,'','bce917fe-85cb-48af-b99c-40bbef942f5d','2018-06-28 17:48:57',2,6,18),(226,'','023a76d7-1b12-49e2-8850-5561565cc13a','2018-06-28 18:39:57',4,6,1),(227,'','cbe0a077-75e2-4f2d-9299-f97eacdc1300','2018-06-28 19:46:24',5,6,9),(228,'','edbe8e54-8be0-4ef1-a68e-908295da83a4','2018-06-28 19:48:31',5,6,1),(229,'','8e6157a5-b271-4470-8581-f73d08d204e1','2018-06-29 09:14:07',4,6,1),(230,'','deb350dc-977b-4ee7-9d5d-338cc9814261','2018-06-29 09:14:35',4,6,9),(231,'Sim, todos des