aro a diferença entre metas e tarefas. Para mim são claras as tarefas de cada funcionário, no entanto as metas são bem obscuras. Entendo que cada time tenha suas metas e que elas componham as metas da empresa, porém o que cada time objetiva não é claro para todos.\r\nInstrutores, inbound, comercial, RH, customer success, design... Quais as metas deles?\r\n','f3785b31-9ebb-4c0b-992f-929318772933','2018-07-03 16:59:02',2,7,8),(272,'A meta da empresa é só vender cursos? Qual o propósito das newsletters, mídias sociais, ou porque escrevemos para o Blog?  Onde ela almeja chegar com tudo isso? Acredito que isto não esteja exatamente claro para as pessoas, o que impacta na questão de porque exercer suas atividades, qual o propósito, visto que não se sabe quais as metas a serem alcançadas.','f322dcc5-4891-47ca-965f-d47bbcfca70b','2018-07-03 17:01:23',3,7,8),(273,'Nós do time de vídeos temos nossa função muito bem estipulada, e temos muita liberdade devido ao gerenciamento que o Sergio tem feito conosco. Então, temos a possibilidade de criar metas para o time que se alinhem a necessidade do negócio.  A única deficiência em relação as metas talvez seja nós as \"comemorarmos\" melhor, para ficar uma sinalização clara de que uma meta foi cumprida e seus efeitos na empresa. ','ea1ae22a-fd15-4f0b-a2b3-4eecc7a326c4','2018-07-03 17:03:45',4,7,20),(274,'','c923bafe-3bba-4c9a-9937-e7120bc3b701','2018-07-03 17:04:30',3,7,20),(275,'','02afbe90-57be-4144-b357-2862fafadc40','2018-07-03 17:04:40',5,7,20),(276,'','32534101-1687-4c78-be75-6eaf748d8c49','2018-07-03 17:05:54',2,7,20),(277,'','c8d8fb6e-6a47-41c1-8447-cdabf7db8468','2018-07-03 17:07:32',5,7,20),(278,'','b8f483f5-2e7e-43be-a13a-11ec945dc116','2018-07-03 17:13:55',4,7,16),(279,'Tenho noção do geral, mas ainda falta uma ideia melhor das metas do comercial, da empresa como um todo, do equilibrio entre lucro e qualidade (dos funcionários e do aluno), das metas de cada parte da empresa.','c77d64ea-727c-4342-a807-e03bcad74e45','2018-0