atingidos nos períodos anteriores, porém cada vez nossas vendas caem, vai se perdendo o ânimo, o foco entre outros e a meta não vem sendo mais atingida ha algum tempo! E para desanimar ainda mais não temos comissão, não atingimos a meta, trabalhamos com vendas mas estamos só com o salário.\r\nEstamos na torcida para que tanto a nova meta, quanto as alterações realizadas internamente, venham fazer a diferença para essa próxima meta!','4532995c-2c44-419d-a870-5f6f247139ce','2018-07-04 09:12:11',3,7,18),(294,'','d3075b0b-0911-4b04-bddf-dd7205bab8e3','2018-07-04 09:45:34',3,7,10),(295,'','3875b1a2-99d6-4fae-8207-ef01bb168d10','2018-07-04 10:16:23',3,7,10),(296,'Sinto que a Alura Start tem metas menos definidas e confusas. Parte da confusão pode partir da falta de publico alvo ou faixa etária dos alunos atuais.','729c4496-5c7d-4549-8078-6d43a6f18f45','2018-07-04 10:46:10',3,7,10),(297,'Às vezes faz falta a empresa explicar para os colaboradores sobre o seu modelo de negócio, pra entender de onde surgem algumas metas','b68fe68d-79aa-4766-9756-76cba0ff84a4','2018-07-04 10:51:06',4,7,17),(298,'','840227e8-b3df-47da-b193-ffb824866a43','2018-07-04 10:55:08',3,7,17),(299,'Apesar das reuniões trimestrais com o Paulo, não me sinto bem informado sobre as metas da empresa de forma satisfatória, sinto que há explicações mais generalizadas. Seria interessante saber como cada time pode contribuir para alcançarmos cada uma das metas propostas nestas reuniões, por exemplo.','b12757c8-17ca-4d21-acc5-bed3fcae7558','2018-07-04 10:59:39',2,7,17),(300,'','8b2c008e-5520-47ca-b8e9-7d08a9578757','2018-07-04 11:02:29',4,7,17),(301,'','eeb94db7-5097-4920-9137-ee30ffd9693a','2018-07-04 11:20:05',4,7,11),(302,'','d875579d-6fbd-41ce-8468-d95c9b8389a7','2018-07-04 11:33:00',4,7,17),(303,'','9045dcd4-5bd8-4069-a7d5-66c59ac93f40','2018-07-04 11:37:18',2,7,10),(304,'Se nada mudar no intervalo de 3 meses até a próxima reunião com os chefes, fica fácil de lembrar sim.','43b98f20-b6d3-4f4e-8363-8f937b8010