mente não falam pois acham que vão atrapalhar o trabalho das pessoas. A meu ver, gerir pessoas exige um perfil um tanto mais diplomático e menos técnico que precisa ser desenvolvido nos nossos gestores, talvez assim melhore a qualidade da comunicação entre eles e os funcionários.','ac0d90e8-1e61-47d3-9b4a-27d03d98408e','2018-07-23 16:10:44',2,9,16),(515,'','37de4076-6f8c-4783-aa20-7fb55dfd8f3e','2018-07-23 16:27:21',4,9,10),(516,'','c1c57487-995b-4ccd-a580-67759a409a75','2018-07-24 09:01:19',5,10,2),(517,'','b0f4fe0d-ad00-42a2-8528-2c714bc2cddc','2018-07-24 09:01:20',5,10,2),(518,'','7b068a96-5faa-478e-86e9-42ee06241bfd','2018-07-24 09:05:42',5,10,10),(519,'já foi pior, agora ta melhorando bastante, é muito bom ter um norte :)','1a8eb851-be0c-4631-b962-e072c1cc865e','2018-07-24 09:16:11',4,10,1),(520,'','145869e6-3fb3-43b8-92cd-90f35501e70f','2018-07-24 09:16:14',3,10,10),(521,'','0b73a282-752f-47b9-a6ea-7e26c8eaac48','2018-07-24 10:13:20',2,10,1),(522,'','231a6a8c-a766-49a5-8d0e-8d690f9b22ce','2018-07-24 10:23:37',4,10,16),(523,'Aqui em Brasília não temos \"líder\" por parte dos instrutores. Até então não tinhamos metas definidas, mas agora estamos trabalhando junto com o Alberto, que nos passou algumas tarefas/objetivos e está fazendo um acompanhamento periódico.','51a66364-6715-4c83-9abe-4d637bf5c619','2018-07-24 10:25:49',3,10,12),(524,'Não temos metas muito claras para o time. O que temos são metas individuais de procurar garantir qualidade didática dos cursos a ajudar os instrutores e instrutoras a concluírem os cursos o mais rápido possível, identificar dificuldades e ajudar a solucioná-las, e isso fazemos bem e o nosso líder sempre está comunicando isso.  ','e5c110f2-7ace-43f2-aa77-fc41cd9de2a2','2018-07-24 10:42:51',3,10,16),(525,'','f74d91c2-4e50-4aa1-8cae-f97172d5ec42','2018-07-24 10:48:25',5,10,19),(526,'','a98dc5a0-c0b8-413e-a4b3-2688a0f378d8','2018-07-24 10:48:41',5,10,19),(527,'','306526cf-0850-4770-acb8-ae134028f187','2018-07-24 10:52:42',2,10,10),(5