a29-494d-8afe-6a197365b37c','2018-08-21 17:09:52',5,11,11),(621,'','5211a6c8-97f5-4902-9018-ef7abc6e67b8','2018-08-21 17:14:09',5,11,7),(622,'','b73f794d-9ef5-40c6-abb8-82480ff62f21','2018-08-21 17:26:28',5,11,7),(623,'','e733c9fe-fd70-42e7-baec-f16bb91fb211','2018-08-21 18:01:15',5,11,2),(624,'Apesar da minha faculdade, creio que consigo conciliar os dois muito bem, pois estudo para os dois.','47234373-9d55-4c65-a2ae-a195b74b289e','2018-08-21 18:01:45',5,11,2),(625,'Trabalho é trabalho e pessoal é pessoal','af69faa8-d70e-4f85-b1f8-174437964da4','2018-08-21 18:02:08',5,11,2),(626,'Muitas vezes ocorre que preciso cancelar algo na vida pessoal pois não há ninguém para substituir. Além disso, muitas vezes contam conosco sem previamente consultar nossa disponibilidade.','ebfa6e84-3e0d-4b70-a1dd-63ddff07fc14','2018-08-21 18:02:18',3,11,1),(627,'','b7bb0dd2-e949-4d17-94c2-0a227563d55e','2018-08-21 18:07:31',3,11,7),(628,'Por um lado, o fato de ser horário flexível, de poder escolher se trabalha 30 ou 40 horas, de poder trabalhar de home office vez ou outra quando precisar, é sensacional! Algo que me permite fazer várias coisas em horários bizarros, coisas que eu não poderia fazer se fosse o horário comercial de trabalho. Valorizo isso demais!\r\n\r\nPor outro lado, o fato de em algumas semanas dar aula à noite e em outras dar aula de manhã impossibilita qualquer aula regular que exija presença. Coisas como curso de línguas, de dança, que seja à noite, se pegamos 2 noturnos seguidos, perdemos o mês inteiro (que pode ser parte de um e parte do outro). Considero como ossos do ofício, mas é o que me impossibilita de poder equilibrar melhor ainda. Outra coisa que já considero menos ruim é não poder tirar férias em Janeiro nem em Julho, mas é só porque tem eventos que eu gostaria de ir nesses dois períodos.','e2e63eb9-4df3-4e31-a999-4f498a519f44','2018-08-21 18:10:00',4,11,1),(629,'Sim, acho que sempre foi o que acho mais valioso de trabalhar aqui, poder conseguir ter uma rotina sustentável de vida pessoal e trabalho, possibilitando eu conseguir fazer cursos fora mesmo conflitando com a hora de trabalho e podendo ajustar graças ao horário flexível. Só não é 5 pq estamos muito sobrecarregados de aulas e atribuições. ','dccc2f88-21d3-4cdb-889d-d02d8dd38e35','2018-08-21 18:43:31',4,11,1),(630,'','51a84fb8-de13-4e1c-bf1c-6cb30df60a6d','2018-08-22 10:39:15',5,11,12),(631,'','6532a123-eaeb-4a16-8171-2d7076878622','2018-08-22 10:44:25',4,11,2),(632,'','90b8231f-688f-45a0-a846-4ec20fdb24bc','2018-08-22 10:45:49',5,11,16),(633,'','9dfb9260-3bf4-4450-b85d-2fbea04b1d1c','2018-08-22 10:54:14',4,11,20),(634,'','909d363c-872d-4d92-b08b-e06a43be0597','2018-08-22 11:04:52',5,11,11),(635,'','8180bd04-a777-412b-a36a-9b01c39cb5b4','2018-08-22 11:55:48',5,11,20),(636,'','aefe451f-9883-447a-8f94-a111403136ac','2018-08-22 11:58:33',4,11,17),(637,' ','b69634a5-bc99-4d94-b145-e03f8cc70cca','2018-08-22 11:58:54',4,11,17),(638,'','6161adf8-c630-4bc3-af54-0428f8da4349','2018-08-22 12:50:53',4,11,20),(639,'','021bffe8-9e06-40ab-a191-631201e8f537','2018-08-22 13:04:40',5,11,17),(640,'','5f681628-01f5-4dad-9215-f71cc2aeb10e','2018-08-22 13:09:46',5,11,20),(641,'','68fc2259-2152-4252-b05d-f043ed1e1043','2018-08-22 14:22:42',5,11,15),(642,'','1088bbf1-dff1-47a6-8dbb-40c918e273d9','2018-08-22 14:22:58',5,11,15),(643,'','bc95bb43-f8ee-43b6-923d-10e45720ba3e','2018-08-22 14:55:26',5,11,15),(644,'','fc840f26-471a-4c80-ad18-4b94b9c81f5f','2018-08-22 15:03:34',5,11,12),(645,'','e769b66d-16ac-4574-9549-5707441b67be','2018-08-22 15:15:27',5,11,9),(646,'','a338d14c-eab8-41db-aa40-5a6f19a303f0','2018-08-22 15:17:28',5,11,15),(647,'','687ec3f9-e318-43bf-a6cd-ef59faf01d54','2018-08-22 20:24:55',5,11,18),(648,'','ea868628-6d10-4190-aceb-9219885c7269','2018-08-23 07:12:03',4,11,19),(649,'A empresa é flexível e compreensível, nos permite solucionar os problemas pessoais. Tem uma harmonia no ar que faz com que as pessoas se comuniquem mais e sejam fiquem mais próximas, não havendo nenhuma desavença as pessoas. ','e7eb88b4-a09e-44e5-81a6-6f3c87997eed','2018-08-23 07:47:40',5,11,18),(650,'','ed3b851d-d1ed-4b20-bba1-8ea709e262b7','2018-08-23 08:16:10',4,11,4),(651,'Definitivamente, na Caelum é onde consegui o melhor work-life balance em toda minha carreira. Isso melhorou muito minha qualidade de vida e é uma das razões para me manter na empresa','618c5ac3-5c84-4134-b90b-64722dfed3a0','2018-08-23 08:28:49',5,11,10),(652,'','29e23d6c-b3ac-4da1-8ac1-fddc5de00095','2018-08-23 08:37:54',5,11,6),(653,'','96a84dfd-71e9-4ba8-aa3a-6e979f576667','2018-08-23 08:51:51',4,11,6),(654,'','a05ce4c0-2c4c-4a43-a9a3-81805478029d','2018-08-23 09:14:01',5,11,10),(655,'','45c6640b-d931-4f1d-87e5-56ef35c10611','2018-08-23 09:20:44',3,11,6),(656,'','0b58d290-15a2-4588-a878-5d0f71a11132','2018-08-23 09:45:03',5,11,19),(657,'Com a possibilidade de home office uma ou duas vezes por semana seria perfeito.','11555fd0-b220-4c95-9fa9-5b06eb4de3aa','2018-08-23 10:08:05',4,11,10),(658,'','a58c278a-a546-4f8c-9e74-060430eeab3a','2018-08-23 10:15:06',5,11,6),(659,'','e9b6d6f7-e5c8-44ae-8080-99220c70bd91','2018-08-23 10:27:26',4,11,10),(660,'','94f55d9a-7e1d-4b17-9f6f-3bb10474bd18','2018-08-23 10:30:36',4,11,18),(661,'Sim, é bastante flexível ','c3fecd5b-c041-4b6c-b02e-7ba9f56c1498','2018-08-23 10:33:57',5,11,6),(662,'','aec30926-1306-485d-b1a2-45e8d81f63a2','2018-08-23 10:37:20',4,11,18),(663,'Consigo equilibrar muito bem, acho interessante o fato de podermos ,sair mais cedo na sexta feira, conforme o horário escolhido. A possibilidade de compensar horas caso necessário, seria interessante futuramente implantar home office.\r\n','ba139924-6bbb-4b51-aee2-675dacedd8e5','2018-08-23 10:44:13',5,11,19),(664,'','93c201d4-07a8-4c84-bee7-372e92d3e00f','2018-08-23 10:55:54',5,11,18),(665,'O tempo que levo para chegar e voltar do trabalho é muito grande. Se trabalhasse 2x por semana home, acredito que poderia melhorar mais minha vida pessoal fazendo um esporte físico, por exemplo.','c0059331-4f9f-4efd-8202-7c0156fe7e0a','2018-08-23 10:59:52',3,11,10),(666,'','fad3b371-6984-42ea-b931-9c238b0ef78a','2018-08-23 11:04:21',4,11,1),(667,'o trabalho é corrido demais com exigência muito alta e tempo curto, parece que nunca paro de trabalhar.','6aab4895-5a65-4e63-b269-5e642db07c47','2018-08-23 11:19:12',2,11,10),(668,'','30513c7d-81f6-4795-8d41-45547a22b395','2018-08-23 11:47:58',5,11,19),(669,'','061e1a3f-f257-4e2d-b066-947f14a0f176','2018-08-23 11:54:13',5,11,14),(670,'','bd56652c-0454-46e4-80d3-8ba350c20271','2018-08-23 12:30:19',5,11,10),(671,'','9965ef6f-fb77-48da-9870-68c6d43c5741','2018-08-23 12:55:15',5,11,19),(672,'A carga horária de trabalho ficou bem pesada com a mudança para 44 horas semanais. Seria bom ter opção de várias cargas horárias, assim ninguém fica devendo horas para a empresa, pode receber pelas horas extras trabalhadas (sem ser obrigado a folgar) e poderíamos trabalhar de forma mais humana e saudável.','a82649cb-85db-49f1-b6fb-aecf102ded4f','2018-08-23 13:17:43',4,11,18),(673,'Acho que vou até usar esse espaço para agradecer, estou passando um momento difícil com a minha vó ( ela está muito doente) e o tempo inteiro, desde a desconfiança da doença, até a confirmação, não teve 1 pessoa do meu time que não prestou ajuda, compaixão, carinho e cuidado comigo. Me sinto acolhida de verdade, e seria ingratidão eu dizer que não consigo equilibrar. Muitas vezes fica corrido, porque trabalhar e estudar não é fácil, mas sempre tentam o máximo ajudar.\r\nEu saio super tarde daqui normalmente, então chego super tarde em casa, e fico muito muito pouco com a minha vó. Depois que descobrimos a doença dela, comecei sair mais cedo, e fazer home-office com os e-mails a noite em casa, e assim consigo aproveitar um pouco mais a minha vó, e cuidar dela, porque ela precisa de ajuda até para levantar agora... ):\r\nEnfim, só queria esclarecer, que nesse momento que estou mais precisando de ajuda e flexibilidade, estou tendo. A minha chefa confiou no meu trabalho, e me permitiu aproveitar um pouco mais o tempo restante com a minha vó, e isso pra mim foi muito muito importante!!!\r\n\r\nobrigada!!','6a907f8d-830a-424b-8d3e-740452431476','2018-08-23 13:22:03',5,11,6),(674,'','3c0f9e32-d2cd-4478-8976-778407b385db','2018-08-23 13:22:45',2,11,4),(675,'Exceto o feriados, que pelo menos na Alura poderia ser home office, já que o atendimento é a distância.  Escala do final do ano também poderia ser passada antes, assim podemos programar viagens etc. Referente a mudança de horas extras virar banco de horas quando tem muito acumulado, deveria ser algo opcional o \'\'banco de horas\'\'  pegar folga sim ou não, já que muita das vezes as horas extras são justificáveis. \r\n\r\nComo feedback extra, o VR é muito baixo pela região, muita das vezes temos que almoçar em lugares não desejaveis pelo preço ser mais em conta, ou optar por trazer marmita (o que é muito bacana, ter uma copa e espaço pra isso), porém não acho o valor pago no vr adequado em relação a região. Além disso, o valor pago no VA é quase uma vergonha hahah notório que é pago pra cumprir \'\'leis\'\' mas todos sabemos que o valor de R$60,00 não da pra comprar uma cesta bacana no mercado.','2429ac76-0cda-45fc-9983-26389beccd0e','2018-08-23 13:31:13',4,11,6),(676,'','95d7c97d-3470-4e71-9553-d206305c1a91','2018-08-23 13:42:02',2,11,18),(677,'A Caelum é uma empresa realmente muito diferenciada nesses aspectos, e tenho certeza que nem empresas como o Google, LinkedIn e Facebook (que são consideradas super inovadoras e flexíveis) tenham essa flexibilidade. \r\n\r\nGosto muito de poder ter um horário flexível, poder fazer esse \"jogo\" com as horas, pegar alguns dias quando eu preciso sem estar de férias, fazer home office algumas vezes e também ter a flexibilidade aqui dentro mesmo de poder ir tomar um café e coisas assim, em outros empregos não podia ficar mais de 10 minutos tomando café que reclamavam.  \r\n\r\nIsso tudo auxilia fortemente em minha produtividade, pois consigo aproveitar dos dias e momentos mais produtivos, e   respirar nos dias que possuo algum problema ou bloqueio, e também auxilia muito para o equilíbrio da vida pessoal e profissional, pois é possível fazer viagens curtas, aulas, descansar e resolver pendências pessoais sem atrapalhar o trabalho (claro que precisa ser feito com consciência e pagar as horas corretamente - exatamente para haver um equilíbrio correto).  ','9bc7c2b1-33ca-4ad3-86d0-af90056904e8','2018-08-23 14:02:16',5,11,14),(678,'','16c03869-52cc-426d-95e4-3de86268da56','2018-08-23 15:34:50',3,11,9),(679,'Fica complicado, pois como tenho e-mail e slack no celular, as informações chegam e acabo resolvendo, fora do meu horário de trabalho','31006c0f-92f3-446a-9d5c-56d0bab0cf11','2018-08-24 11:56:43',1,11,19),(680,'','e95d3cb5-aa8a-453b-a196-ceabaf675816','2018-08-24 12:11:14',4,11,8),(681,'','277d9e34-1281-49f4-8772-4e03156aab30','2018-08-24 12:12:34',5,11,8),(682,'','ea8fd767-1833-4a06-bf88-5c02a2af92f4','2018-08-24 12:15:44',5,11,8),(683,'Os horários flexíveis é um dos fatores que ajuda a equilibrar minha vida pessoal e profissional','28250875-9d40-4884-a705-7c25dc2cbb30','2018-08-24 12:17:44',5,11,8),(684,'','6018f7b7-affe-41cc-b389-f2d9fc96ed35','2018-08-24 12:47:22',5,11,8),(685,'','a9305e28-fb9a-429d-b60d-5b622f55ba59','2018-08-24 13:27:46',5,11,8),(686,'Permite equilibrar. Não significa que todos CONSIGAM, mas o trabalho permite. Respondi baseado no enunciado e não nas opções de votação.','f4641e0e-4be0-4ad0-8c1c-10eea17ecf3a','2018-08-24 13:50:26',5,11,8),(687,'','09dff747-3f88-4740-b463-992a207ca9bb','2018-08-24 15:45:47',5,11,10),(688,'','a7112abc-8927-4f0b-813f-b343c90bd94b','2018-08-27 09:50:01',5,11,8),(689,'a caelum ajuda e \"entende\" as coisas que temos pessoais. Mas ainda assim, passamos mais tempo se dedicando ao trabalho do que a nossa vida pessoal em si.','b12b51e5-25d7-4016-8a5f-27ff68757d16','2018-08-27 16:10:15',4,11,19),(690,'','26386325-2995-40d2-9dc6-fb7421fdd8bb','2018-08-29 09:53:52'