mente, mais de 50% e a maioria é devido aos cursos desatualizados. O que sentimos é uma perca de qualidade e aumento de volume, não sabemos até que ponto isso é importante. Isso em relação aos cursos online. Casa do Código ficou \'\'abandonada\'\' por muito tempo em relação a novos projetos e melhoria, agora com o Sr. Carlos acredito que haverá uma grande melhora. Já os presenciais, também é notório uma insatisfação dos instrutores, muito deles estão migrando ou tentando migrar, porém não tenho muito contato nem estou á par. ','d3f91c4d-316f-44da-8275-6bf18b339318','2018-09-05 09:43:06',2,13,6),(792,'','9ad024a1-bffa-406d-90db-869b91bf7bc1','2018-09-05 09:44:52',4,13,4),(793,'','70e92806-5962-46f9-b815-b2d9e9a1e498','2018-09-05 09:49:06',5,13,10),(794,'','3aaac1ad-105a-42b5-8334-d27e91443fa2','2018-09-05 09:49:35',5,13,19),(795,'','9a9d1ae4-9d49-4fbb-be01-ddd5bf260f9c','2018-09-05 09:50:47',3,13,4),(796,'','bf3e4fbb-56b3-4a7e-82d0-2ec4d0338cc0','2018-09-05 10:22:20',3,13,6),(797,'Acredito que a empresa deveria se preocupar não só com o lançamento dos cursos, mas também com a atualização de conteúdo. Isso é o que mais os alunos reclamam. ','2c313a53-feec-4cb2-820f-33cbd4e4ad5a','2018-09-05 10:24:18',2,13,6),(798,'cursos presenciais desatualizados','acdad3f1-c7c7-4978-b7d4-6779783bb47f','2018-09-05 10:41:40',4,13,6),(799,'','61b6f510-5edf-4f43-a65d-71d06ff068ac','2018-09-05 11:06:37',4,13,19),(800,'','9e1cb2fc-cd19-4b78-ae20-7aaf150536a2','2018-09-05 11:10:20',5,13,10),(801,'','2eef8f2f-6afc-4a48-a46c-ac7c8776316a','2018-09-05 11:11:22',3,13,6),(802,'','a8ca31bb-3b32-44ef-bcdf-0349001bb8ac','2018-09-05 11:15:08',4,13,10),(803,'','262c8ded-0c31-4010-a583-192dcff975a5','2018-09-05 11:24:13',4,13,19),(804,'Atualmente mais ou menos, mas poderia ser melhor. Principalmente levando em consideração os cursos presenciais.','05b8020b-33b0-4f2f-a999-9b797ee2046f','2018-09-05 11:32:32',3,13,18),(805,'','80267d76-ae54-471a-a1e9-19a213b786fd','2018-09-05 11:45:05',5,13,19),(806,'','609a2d7a-cc9a-4b77-b12c-c1f505652857','2018-09-05 11:45:31',3,13,18),(807,'','32a56de4-e42c-4303-a3dd-b566fa1c9a58','2018-09-05 11:46:46',5,13,8),(808,'','f0d7ce28-c997-4845-947d-7bcab81dd912','2018-09-05 11:48:12',5,13,8),(809,'','bb5d0578-824a-466d-a51c-0865d7d81389','2018-09-05 11:53:56',5,13,18),(810,'SE ALGO ESTA SENDO FEITO PARA MELHORIAS DO PRODUTO QUE OFERECEMOS, EU DESCONHEÇO','e45af2c2-10b8-48d1-b522-cc771bedefdb','2018-09-05 11:56:28',2,13,18),(811,'','c9f60d41-d291-4962-aeb5-778a83c85993','2018-09-05 11:58:27',5,13,8),(812,'','823e7bee-13ef-4a0f-9fb3-236dbed8da82','2018-09-05 12:03:59',5,13,14),(813,'É possível ver o esforço para melhorar o produto em muitos aspectos, porém há muitas coisas simples que podem ser melhoradas e são deixadas de lado. Existem muitos erros de português (e digitação) nas páginas dos sites da Alura e Caelum, exercícios fracos em muitos cursos e alguns cursos que poderiam ser mais elaborados. Algumas coisas que parecem pequenas, mas que repetidas constantemente se tornam grandes. \r\n\r\nÉ impossível um produto ser perfeito, mas com um pouco mais de atenção muitos desses problemas seriam evitados...  ','512163f4-7e74-4c17-99de-840a09c049e8','2018-09-05 12:30:29',3,13,14),(814,'Temos muitos cursos antigos que precisam ser regravados, e mesmo lançando muito cursos novos, a reclamação dos alunos é que não estão focando na qualidade.','ad17c085-afad-41ac-ae11-b1ef674b9010','2018-09-05 13:15:53',3,13,6),(815,'','8cb70cbe-b965-439d-994b-736bcbb147a4','2018-09-05 13:25:39',4,13,10),(816,'','6dd595d3-019a-48ba-aafd-637dacf375f8','2018-09-05 13:36:33',5,13,4),(817,'Certas partes da empresa me parecem um pouco estagnados e resistentes a novas mudanças, isso pode levar a perda de competitividade no mercado. Acho que falta uma pessoa focada no desenvolvimento de cada produto do grupo, como um product owner da Alura, Aluralingua, Musicdot, Casa do código e etc, atento as tendências do mercado e dos competidores afim de propor novas funcionalidades e melhorias. ','85b10fab-3261-4d5d-986e-f80eec62de90','2018-09-05 13:58:28',3,13,8),(818,'','107210ab-36f6-404b-9965-6a085309c66e','2018-09-05 14:03:16',5,13,8),(819,'Não percebo muita melhoria nos produtos, temos muitos cursos desatualizados, livros desatualizados, e os autores e instrutores não parecem estar interessado em atualizar, não me impressiona muitos devs saindo da empresa, para outros projetos. Acho que começa a pegar mal, ainda mais quando não tem gente para ajudar nos problemas que surgem. A preocupação da empresa está sendo somente para o dinheiro infelizmente.\r\n','74bdde46-730c-46c4-acb1-577009d65599','2018-09-05 15:02:55',2,13,6),(820,'','003f3cfd-aebd-4397-a521-818752f9757a','2018-09-05 15:57:27',5,13,13),(821,'','54ddc142-f8d3-41b2-b5b9-dfdccdeef33d','2018-09-05 15:59:00',5,13,13),(822,'','099b8451-2365-4f15-9a64-bad2d37a47e0','2018-09-05 16:00:51',4,13,18),(823,'','be5ca990-39e4-47d1-9203-55f9f0678add','2018-09-05 16:03:11',4,13,2),(824,'A empresa sempre está melhorando isso é claro. Agora as vezes eu não sei o quanto essa melhora no produto considera a forma como mudar um processo pode impactar nas pessoas.','acf50221-3297-4fc0-8e20-0cf83458e61c','2018-09-05 16:04:59',5,13,1),(825,'','2b1132aa-a2d2-4fc4-8435-c306b59c897c','2018-09-05 16:25:15',5,13,11),(826,'','fcfcdf3c-9467-49fc-863f-3616f1fd2d25','2018-09-05 16:27:38',5,13,1),(827,'Vemos que o trabalho dos técnicos é constante, mas recebemos feedbacks diretos sobre conteúdo desatualizado e demora na resposta do fórum. Além de alguns setores não terem este suporte.','24ccc3fe-437c-439a-b167-1e1496a8fb58','2018-09-05 16:50:26',4,13,18),(828,'Acredito que nesse instante estamos atacando fortemente as atualizações e criações de serviços novos(cursos), contudo ficou um grande tempo sem fazer isso e da forma que foi dialogada parecia não ser tão importante.','fcdf5a8b-5454-443c-a170-f76453f6aae2','2018-09-05 17:05:20',3,13,1),(829,'','cd782fa8-df49-45f1-93c1-cb72b61e64ef','2018-09-05 17:05:23',3,13,1),(830,'','83fb7db4-7e97-4ca0-ad5d-ef2c1fcf371b','2018-09-05 17:11:09',5,13,2),(831,'Sempre é discutido novos meios e formas de se abranger o produto e deixar ele cada vez mais claro, sólido e robusto. Vejo isso no dia a dia, mesmo que as vezes com certas falhas. ','b81652a7-c734-4fa2-a114-29ec7e6ffd9b','2018-09-05 17:55:13',4,13,14),(832,'','8767c75a-0dd1-4fe6-a84a-8842b8797735','2018-09-05 18:06:02',4,13,11),(833,'','1e191b34-0d2d-411c-9923-7632279359f6','2018-09-05 18:24:36',4,13,12),(834,'Do meu ponto de vista, parece que a empresa tenta melhorar sim os produtos ou serviços, mas sem se preocupar com qualidade e apenas quantidade. Muitas vezes ouvimos alunos falando que faltam cursos avançados na Alura, mas parece que nada é feito, já que as críticas dos alunos continuam. Ou as críticas que são passadas com frequência sobre os cursos e que sei que são passadas adiante, parece que muitas vezes nem uma satisfação é dada. No presenciall, a sensação que fica é a mesma. Cursos e instrutores que recebem críticas com frequência continuam como estão e o trabalho parece que é voltado só para criar novos cursos (sendo que agora nem instrutores temos, já que muitos foram embora e estamos cancelando turmas, o que influencia na nossa meta e nosso resultado). Posso estar vendo errado, mas como nada disso é comunicado para quem está aqui ouvindo as queixas de quem paga pelo nosso serviço, essa é a sensação que ficamos. O Paulo fez uma conversa com toda a empresa e falou de várias coisas que nem me lembro mais, mas tirando os planos novos do Alura, não sei mais o que foi feito e nunca mais houve uma satisfação sobre aquilo, ficando parecendo até que foi mentira ou algo para passar uma impressão.','9590f426-e3a1-42fc-a6a4-c05b62dcf994','2018-09-05 18:40:29',2,13,18),(835,'','71edad9e-ec64-414c-88c0-ab3d79c39388','2018-09-05 18:59:13',4,13,11),(836,'','27d9c5c1-b665-4afd-8f2c-14f7d11998e1','2018-09-05 20:56:56',3,13,2),(837,'','d82e12b9-4278-4cef-9fa1-fd780fbb839c','2018-09-05 23:08:15',5,13,1),(838,'','6977bfd4-e6f4-4ba4-97df-6e65903eafaf','2018-09-05 23:40:47',5,13,11),(839,'','997e9d56-72d2-4d95-965e-85b6af6ab17e','2018-09-05 23:57:48',5,13,1),(840,'Já respondi com um 5 mas decidi responder de novo com um 4. A empresa trabalha constantemente na melhoria do FOCO do produto/serviço mas não (mais) nas coisas periféricas. Internet média, privadas com tampa quebrada, computadores lentos e/ou com algum erros de configuração, ar-condicionado funcionando com alguns defeitos, etc','774b68aa-3b96-4cb5-88c4-5c104c7da64b','2018-09-06 00:00:26',4,13,1),(841,'','105d8e83-a49f-4714-981d-7bc45f7a6d61','2018-09-06 08:50:08',5,13,8),(842,'','75cbf7f2-ef64-4808-9575-6ad71b24b6a6','2018-09-06 09:24:38',4,13,17),(843,'O ambiente poderia ser melhor. Um ambiente melhor gera funcionários mais satisfeitos e consequentemente melhoria no produto','d3bddb91-66d7-4de8-9a2e-32e2bcf1770a','2018-09-06 10:05:07',3,13,13),(844,'','e4cba3ba-8792-4410-8e95-dd78d731a745','2018-09-06 10:11:33',2,13,6),(845,'','bf6df9ba-c950-4c94-a637-d53791d48d5e','2018-09-06 12:48:47',5,13,12),(846,'','3cdb8468-6e81-4dfc-86f7-196b4c1fbad9','2018-09-06 13:00:20',5,13,17),(847,'','7280f5db-d2aa-4c31-9847-aeaad42d07e4','2018-09-06 13:33:30',3,13,13),(848,'','d200d434-7650-43a2-a68c-739354e07f1f','2018-09-06 14:54:03',5,13,14),(849,'A infra deve ser melhorada. Sempre temos reclamações com os computadores e internet','75cb3eba-5dcf-4b71-84a9-2692db2f70b6','2018-09-06 15:05:13',4,13,19),(850,'A empresa tem feito muitas iniciativas pra melhorar os cursos (fazendo cursos novos, atualizando mais os existentes, melhorando os processos), mas estava muito defasada com as tecnologias do mercado, estamos no processo. Com estamos iniciando esse processo de melhoria maior, ainda não sei dizer se está numa melhoria constante.\r\nAlém disso, ainda sinto que as apostilas podiam passar por revisão de português.','6083f4da-ceab-4d98-a007-f00cdb9ec05f','2018-09-06 20:31:15',3,13,1),(851,'','18116502-cca9-46ee-b35c-04ef56bc1212','2018-09-07 10:48:35',5,13,1),(852,'','fc9cb8af-ae39-4c1b-8921-6ea5f7bf6d72','2018-09-08 09:33:05',5,13,9),(853,'','b8c5bec7-7f55-4d29-b9ce-87ad4bac7380','2018-09-10 09:23:30',4,13,9),(854,'É notável que, recorrentemente a empresa realiza novas contratações, além de criar produtos novos e sempre buscando aprimorar os já existentes.','3fdb3603-5850-4fa9-86ed-0da540447a14','2018-09-10 09:37:56',5,13,9),(855,'','c4bffccd-2b50-47e4-97c3-d03ab33080ff','2018-09-10 14:02:07',5,13,9),(856,'','70e0a4b6-ed20-469d-81b9-417d19813873','2018-09-10 17:14:36',2,13,10),(857,'','1ea27e26-a8f6-4506-8504-b581891bb121','2018-09-11 08:36:48',5,14,18),(858,'','033ae22e-48e8-4952-8542-a202b86d244a','2018-09-11 09:01:08',4,14,20),(859,'','600d4b34-4c51-4b83-aedd-621bd3864a1d','2018-09-11 09:26:44',1,14,10),(860,'','4c52c958-360d-4a37-833f-d9411b4b564c','2018-09-11 09:31:05',2,14,17),(861,'','ef900d70-93f4-4aa7-8620-d552017a9238','2018-09-11 09:49:04',2,14,16),(862,'Sei que está avaliando pelo andamento dos trabalhos e oportunidades recebidas. Mas COMO ele faz isso, não sei. Talvez um feedback mais preciso, um 1:1, ajude a deixar isso mais claro. ','03d910fb-a174-4685-aa53-3607a858b0ff','2018-09-11 09:55:28',3,14,16),(863,'','6bf0801a-9f49-4410-9209-282d971b6e9a','2018-09-11 10:05:37',4,14,5),(864,'','ebdeb35f-3be7-4ce8-8354-fbcdcf357cda','2018-09-11 10:05:47',5,14,10),(865,'No geral é subentendido que o meu/minha líder reconhecem a minha performance, porém, sinto falta de uma avaliação mais detalhada com destaques do que fui bem ou não e o que vale a pena melhorar.','a9426c17-6ae0-4191-9199-e8a187093694','2018-09-11 10:43:39',3,14,10),(866,'','9f65848d-e1e1-4359-870a-2baceb322575','2018-09-11 10:56:28',1,14,16),(867,'Faltam métricas relativas a progressão de carreira','5c6b24f6-3b7c-4aab-99c5-4a0e64142a93','2018-09-11 10:56:34',4,14,10),(868,'','146c871b-a867-4696-8fad-262076d9e403','2018-09-11 11:14:26',5,14,17),(869,'','82eb1d39-c04c-41ba-8916-a98caadd217f','2018